import { useState } from 'react';
import OrderShowBarStyle from '../Style/OrderShowBar.module.css'

const OrderShowBar = () => {
    const [showTrue, setShowTrue] = useState(false)
    return (
        <>
            <div className={OrderShowBarStyle.orderShowBar}>
                <div className={OrderShowBarStyle.orderShowBarImage}></div>
                <div className={OrderShowBarStyle.orderShowBarTitle} onClick={() => setShowTrue(!showTrue)}>ORDER STATUS</div>
                <div className={OrderShowBarStyle.orderShowBarContent}>2</div>
            </div>
            {showTrue && <div className={OrderShowBarStyle.orderShowBarContent}>2</div>}
        </>
    )
}
export default OrderShowBar;
